import React from 'react';
import './Skills.css'
import JsLogo from './JsLogo.svg';
import HtmlLogo from './HTML5_Badge.svg';
import CssLogo from './css3-logo.png';


const Skills = (onRouteChange) => {
	return (
		<div>
			<p style={{margin: '0px', 'margin-top': '30px', color: 'white', 'font-size': '40px'}}>What I got</p>
			<div className='ContainerWrapper'>
				<div className='SkillContainer'>

					<img className="HtmlLogo" src={HtmlLogo} width="" height=""/>
					<img className="CssLogo" src={CssLogo} width="" height=""/>
					<div className="JsBundle">
						<img className="JsLogo" src={JsLogo} width="" height=""/>
					</div>
				</div>
			</div>
		</div>

		)
};

export default Skills;
